ion_error:"Fehler bei der PDF-Generierung",generating_pdf:"PDF wird generiert...",director:"Geschftsfhrer",technical_director:"Technischer Direktor",director_bio:"ber sieben Jahre Erfahrung in Finanzmrkten und Kryptowhrungen, mit einem starken Hintergrund in Vertriebsteamleitung, Geschftsentwicklung und Marktanalyse. Nachgewiesene Fhigkeit, Umsatzwachstum zu frdern, strategische Partnerschaften aufzubauen und komplexe Finanzlandschaften zu navigieren.",technical_director_bio:"Zehn Jahre Erfahrung als IT-Administrator fr groe Marken in ganz Europa, mit umfassender Expertise in Systemarchitektur und Cybersicherheit.",connect:"Verbinden",refund_policy:"Rckerstattungs- & Auszahlungsrichtlinie",refund_policy_content:`RCKERSTATTUNGS- & AUSZAHLUNGSRICHTLINIE

Diese Richtlinie beschreibt die Bedingungen fr Rckerstattungen und Auszahlungen auf der EvokeEssence-Plattform.

1. Gebhren
 Alle von EvokeEssence erhobenen Provisionen sind unter KEINEN Umstnden ERSTATTUNGSFHIG
 Provisionen werden vor der Besttigung einer Transaktion deutlich angezeigt
 Durch das Fortfahren mit einer Transaktion besttigen Sie die Kenntnisnahme und Zustimmung zur Gebhrenstruktur

2. SEPA-Einzahlungen
 ber SEPA-berweisungen eingezahlte Gelder knnen per SEPA ausgezahlt oder in Kryptowhrung umgewandelt werden
 SEPA-Auszahlungen werden innerhalb von 1-3 Werktagen bearbeitet
 Fr alle SEPA-Auszahlungen fllt eine nominale Gebhr von 1,50  an
 Mindestauszahlungsbetrag: 20 

3. Kryptowhrungskufe & -Auszahlungen
 Sobald Kryptowhrung gekauft und von unserer Plattform abgehoben wurde, ist KEINE Rckerstattung mglich
 EvokeEssence hat keine Mglichkeit, Kryptowhrungstransaktionen nach ihrer Besttigung in der Blockchain rckgngig zu machen, zurckzurufen oder zu erstatten
 Die Benutzer sind allein dafr verantwortlich, Auszahlungsadressen vor der Einleitung von berweisungen zu berprfen
 Netzwerkgebhren fr Kryptowhrungsauszahlungen werden vom Benutzer getragen und sind nicht erstattungsfhig

4. Stornierung ausstehender Auftrge
 Ausstehende oder nicht zugeordnete Auftrge knnen vor der Ausfhrung storniert werden
 Fr die Stornierung nicht ausgefhrter Auftrge werden keine Gebhren erhoben

5. Auszahlungsbeschrnkungen
 Auszahlungen knnen aus Sicherheitsgrnden oder aufgrund von Compliance-Anforderungen vorbergehend eingeschrnkt werden
 Fr neue Einzahlungen kann eine Haltefrist von bis zu 3 Werktagen gelten, bevor eine Auszahlung mglich ist
 Wir behalten uns das Recht vor, zustzliche Verifizierungen vor der Bearbeitung groer Auszahlungen zu verlangen

6. Fehlgeschlagene Transaktionen
 Bei fehlgeschlagenen SEPA-Auszahlungen werden die Mittel auf Ihr EvokeEssence-Kontoguthaben zurckerstattet
 Technische Probleme mit Kryptowhrungsnetzwerken knnen Auszahlungen verzgern, werden aber so schnell wie mglich behoben

Durch die Nutzung unserer Plattform besttigen und akzeptieren Sie diese Rckerstattungs- und Auszahlungsbedingungen. Bei spezifischen Fragen zu dieser Richtlinie wenden Sie sich bitte an unser Support-Team.`,risk_disclosure:"Risikooffenlegung",risk_disclosure_content:`OFFENLEGUNG VON KRYPTOWHRUNGSRISIKEN

EvokeEssence s.r.o. stellt diese Risikooffenlegung bereit, um Benutzer ber die potenziellen Risiken im Zusammenhang mit Kryptowhrungstransaktionen zu informieren. Durch die Nutzung unserer Plattform erkennen Sie diese Risiken an und akzeptieren sie.

1. Marktvolatilittsrisiken
 Kryptowhrungskurse knnen innerhalb kurzer Zeitrume dramatisch schwanken
 Preisbewegungen knnen von Faktoren beeinflusst werden, die auerhalb unserer Kontrolle liegen
 Vergangene Wertentwicklung ist kein Indikator fr zuknftige Ergebnisse
 Sie knnen in volatilen Marktbedingungen erhebliche Verluste erleiden

2. Regulatorische und rechtliche Risiken
 Kryptowhrungsvorschriften variieren je nach Gerichtsbarkeit und knnen sich jederzeit ndern
 Regulatorische nderungen knnen sich negativ auf den Wert Ihrer Bestnde auswirken
 Zuknftige Regierungsmanahmen knnten den Besitz oder Austausch von Kryptowhrungen einschrnken oder verbieten
 Die steuerliche Behandlung von Kryptowhrungen kann sich ndern und zu unerwarteten Verbindlichkeiten fhren

3. Technische und betriebliche Risiken
 Blockchain-Netzwerke knnen Verzgerungen, berlastungen oder technische Ausflle erleben
 Softwareschwachstellen oder Fehler knnen die Transaktionsverarbeitung beeintrchtigen
 Cyberangriffe gegen die Plattform oder Netzwerkinfrastruktur
 Datenschutzverletzungen oder der Verlust privater Schlssel knnen zum Verlust von Vermgenswerten fhren

4. Liquidittsrisiken
 Einige Kryptowhrungen knnen begrenzte Liquiditt haben
 Whrend Marktbelastungen kann es schwierig sein, Orders zu gewnschten Preisen auszufhren
 Weite Geld-Brief-Spannen knnen zu weniger gnstigen Ausfhrungspreisen fhren

5. Gegenparteirisiken
 Ausfall von Handelspartnern, Verwahrern oder Dienstleistern
 Potenzial fr Plattforminsolvenz oder Geschftsunterbrechung
 Risiken im Zusammenhang mit Zahlungsabwicklern von Drittanbietern

6. Anlagerisiken
 Potenzial fr vollstndigen Verlust des investierten Kapitals
 Begrenzte Schutzmechanismen im Vergleich zu traditionellen Finanzsystemen
 Keine staatliche oder Einlagensicherung fr Kryptowhrungsvermgen

Diese Offenlegung ist nicht erschpfend und kann nicht alle mit Kryptowhrungstransaktionen verbundenen Risiken identifizieren. EvokeEssence empfiehlt Benutzern dringend, ihre finanziellen Umstnde, Risikotoleranz sorgfltig zu bewerten und unabhngige Finanzberatung einzuholen, bevor sie sich auf Kryptowhrungstransaktionen einlassen. Verwenden Sie nur Mittel, die Sie sich leisten knnen zu verlieren.`,two_factor_authentication:"Zwei-Faktor-Authentifizierung",two_factor_setting:"Zwei-Faktor-Authentifizierung",security_settings:"Sicherheitseinstellungen",manage_security_settings:"Verwalten Sie Ihre Kontosicherheit und den Schutz",setup_2fa_de:"Zwei-Faktor-Authentifizierung einrichten",manage_2fa_de:"Zwei-Faktor-Authentifizierung verwalten",disable_2fa:"Zwei-Faktor-Authentifizierung deaktivieren",disable_2fa_description:"Entfernen Sie die Zwei-Faktor-Authentifizierung von Ihrem Konto",enabled:"Aktiviert",disabled:"Deaktiviert",twofa_enabled_message:"Ihr Konto ist durch die Zwei-Faktor-Authentifizierung geschtzt, was die Sicherheit erheblich verbessert.",twofa_disabled_message:"Zwei-Faktor-Authentifizierung ist deaktiviert. Aktivieren Sie sie fr erhhte Sicherheit.","2fa_disabled_message":"Zwei-Faktor-Authentifizierung ist deaktiviert. Aktivieren Sie sie fr erhhte Sicherheit.","2fa_enabled":"2FA Aktiviert","2fa_disabled":"2FA Deaktiviert","2fa_available":"2FA Verfgbar",mobile_app_title:"Mobile App",mobile_app_description:"Handeln Sie unterwegs mit unserer sicheren iOS-App. Greifen Sie von berall auf Ihre Gelder zu, verfolgen Sie Mrkte und fhren Sie Trades durch.",mobile_app_features:"Hauptfunktionen",mobile_app_feature_1:"Echtzeit-Marktaktualisierungen",mobile_app_feature_2:"Sicherer Handel jederzeit und berall",mobile_app_feature_3:"Push-Benachrichtigungen fr Preisalarme",mobile_app_feature_4:"Biometrische Authentifizierung",mobile_app_download:"Kommt in 2025",mobile_app_available:"Verfgbar Ende 2025",mobile_app_coming_soon:"Android-Version fr 2026 geplant",twofa_disabled_su